static void print_rescale_square (int x_start, int y_start, uint16_t color , int tamagotchi_rescale );
static void clear_tamagotchi_square(display_map_t* map);

/*
1. Print on screen all pixels of matrix with rescaling and tipping
*/
void print_lcd_from_LRMATRIX (uint16_t matrix[][TAMAGOTCHI_REAL_DIM_X/2], int x_start, int y_start , int tamagotchi_rescale){
	int i,j,x_right,x_left;
	
	x_left = x_start;
	x_right = x_start + tamagotchi_rescale * (TAMAGOTCHI_REAL_DIM_X/2);
	
	for( i=0; i<TAMAGOTCHI_REAL_DIM_Y; i+=1 ,x_left = x_start , x_right = tamagotchi_rescale * (TAMAGOTCHI_REAL_DIM_X/2) + x_start ,y_start += tamagotchi_rescale  ){
		for(j=0; j<TAMAGOTCHI_REAL_DIM_X/2; j+=1 , x_left += tamagotchi_rescale , x_right += tamagotchi_rescale  ) {
			//LEFT
			print_rescale_square (x_left, y_start, matrix[i][j] , tamagotchi_rescale);
			//RIGHT
			print_rescale_square (x_right, y_start, matrix[i][( TAMAGOTCHI_REAL_DIM_X/2 )-j-1] , tamagotchi_rescale);
		}
	}
}

/*
2. Print  only delta pixels
*/
void print_lcd_from_DELTAMATRIX ( uint16_t matrix_start[][TAMAGOTCHI_REAL_DIM_X/2] , uint16_t matrix_end[][TAMAGOTCHI_REAL_DIM_X/2], int x_start, int y_start , int tamagotchi_rescale ) {
	
	int i,j,x_right,x_left;
	
	x_left = x_start;
	x_right = x_start + tamagotchi_rescale * (TAMAGOTCHI_REAL_DIM_X);
	
	for( i=0; i<TAMAGOTCHI_REAL_DIM_Y; i+=1 ,x_left = x_start , x_right = tamagotchi_rescale * (TAMAGOTCHI_REAL_DIM_X) + x_start ,y_start += tamagotchi_rescale  ){
		for(j=0; j<TAMAGOTCHI_REAL_DIM_X/2; j+=1 , x_left += tamagotchi_rescale , x_right -= tamagotchi_rescale  ) {
			if(matrix_end[i][j] != matrix_start[i][j]){
				//LEFT
				print_rescale_square (x_left,  y_start, matrix_end[i][j] , tamagotchi_rescale);
				//RIGHT
				print_rescale_square (x_right - tamagotchi_rescale, y_start, matrix_end[i][j] , tamagotchi_rescale);
			}
		}
	}
	
}

/*
3. Print all pixels of matrix (if needed)
*/
void print_lcd_from_FRAME(int x_start , int y_start , int frame_number){
	int x,y, i = 0 , j = 0;
	uint16_t color = White;
	//uint16_t background = LCD_GetBackground();
	
	for( y = y_start , i = 0 ; y<= y_start + IN_MOTION_Y ; y += 1 , i += 1 ) {
		for  ( x = x_start , j = 0 ; x <= IN_MOTION_X + x_start ; x += 1 , j+= 1 ) {
			switch(frame_number){
				case 1 : color = frame1[i][j]; break;
				case 2 : color = frame2[i][j]; break;
			}
			if( color == 0x0 ){
				color = White;
			}
			if ( color != LCD_GetPixel ( (uint16_t) x , (uint16_t)y ) ) {
				
			}
			LCD_SetPoint ( x , y , color );
		}
	}
}

static void print_rescale_square (int x_start, int y_start, uint16_t color, int tamagotchi_rescale ){
	int i,j;
	for( i=0 ; i<tamagotchi_rescale; i+= 1 ) {
		for( j=0; j<tamagotchi_rescale; j+=1){
			LCD_SetPoint ( x_start + j , y_start + i , color );
		}
	}
}

display_map_t display_map_default_init(void){
	display_map_t map;
	map.tamagotchi_square_y1 = TAMAGOTCHI_SQUARE_Y1;
	map.tamagotchi_square_y2 = TAMAGOTCHI_SQUARE_Y2;
	map.tamagotchi_x_start = 0 + TAMAGOTCHI_DELTA_SQUARE_X;
	map.tamagotchi_y_start = TAMAGOTCHI_SQUARE_Y1 + TAMAGOTCHI_DELTA_SQUARE_Y;
	map.lifetime_x_start = 0 ;
	map.lifetime_y_start = 0;
	map.dim_X = TAMAGOTCHI_DIM_X;
	map.dim_Y = TAMAGOTCHI_DIM_Y;
	return map;
}

void display_map_rescale( display_map_t* map, int new_rescale){
	//Clear 
	clear_tamagotchi_square(map);
	
	//Rescale dimensions
	map->dim_X = new_rescale * TAMAGOTCHI_REAL_DIM_X;
	map->dim_Y = new_rescale * TAMAGOTCHI_REAL_DIM_Y;;
	map->tamagotchi_x_start = 0 + (TAMAGOTCHI_SQUARE_X_LEN-map->dim_X)/2;
	map->tamagotchi_y_start = TAMAGOTCHI_SQUARE_Y1 + (TAMAGOTCHI_SQUARE_Y_LEN - map->dim_Y ) / 2;
	
}


static void clear_tamagotchi_square(display_map_t* map){
	int i,j;
	for( i = TAMAGOTCHI_DELTA_SQUARE_Y + TAMAGOTCHI_SQUARE_Y1; i < TAMAGOTCHI_DELTA_SQUARE_Y + TAMAGOTCHI_SQUARE_Y1 + TAMAGOTCHI_DIM_Y ; i+= 1 ) 
		for( j = TAMAGOTCHI_DELTA_SQUARE_X ; j <TAMAGOTCHI_DELTA_SQUARE_X + TAMAGOTCHI_DIM_X; j+= 1 )
			LCD_SetPoint (j,i,White);
}

void clear_tamagotchi_window(void){
	int i,j;
	for( i =  TAMAGOTCHI_SQUARE_Y1; i <= TAMAGOTCHI_SQUARE_Y2 ; i+= 1 ) 
		for( j = 0 ; j < MAX_X ; j+= 1 )
			LCD_SetPoint (j,i,White);
}

void clear_window(int x_start , int y_start , int h , int w ){
	int x,y;
	for( y =  y_start ; y <= y_start + h ; y += 1 ) 
		for( x = x_start ; x <= x_start + w ; x+= 1 )
			LCD_SetPoint (x,y,White);
}

void draw_meal( void ){
	//LCD_DrawCircle( MAX_X - 20 , DISPLAY_CENTER_Y , 10 , Magenta );
	int x,y, i = 0 , j = 0;
	uint16_t color = White;
	
	for( y = DISPLAY_CENTER_Y - MEAL_Y/2  , i = 0 ; y<=  DISPLAY_CENTER_Y + MEAL_Y/2 ; y += 1 , i += 1 ) {
		for  ( x = MAX_X - MEAL_X, j = 0 ; x <= MAX_X ; x += 1 , j+= 1 ) {
			color = meal[i][j];
			if( color == 0x0 ) continue;
			else if ( color != LCD_GetPixel ( (uint16_t) x , (uint16_t)y ) ) {
				LCD_SetPoint ( x , y , color );
			}
		}
	}
}


void draw_snack( void ){
	//LCD_DrawRectangle(MAX_X - 30 , DISPLAY_CENTER_Y , 25 , 15 ,  Red );
	int x,y, i = 0 , j = 0;
	uint16_t color = White;
	
	for( y = DISPLAY_CENTER_Y - SNACK_Y/2  , i = 0 ; y<=  DISPLAY_CENTER_Y + SNACK_Y/2 ; y += 1 , i += 1 ) {
		for  ( x = MAX_X - SNACK_X, j = 0 ; x <= MAX_X ; x += 1 , j+= 1 ) {
			color = snack[i][j];
			if( color == 0x0 ) continue;
			else if ( color != LCD_GetPixel ( (uint16_t) x , (uint16_t)y ) ) {
				LCD_SetPoint ( x , y , color );
			}
		}
	}
}




